    return (
        <div className={`Loader Loader_${size}`}>
            <div className="Loader__circle" style={{ borderColor: color }}></div>
            <div className="Loader__circle" style={{ borderColor: color }}></div>
            <div className="Loader__circle" style={{ borderColor: color }}></div>
        </div>
    );
};

export default Loader;
